INSERT INTO reviews (nama_pengulas, rating_bintang, teks_ulasan, topik_utama, sentimen, nama_cafe) VALUES ('yuliana rahmawati', 5, 'The place is quite small. For working on a laptop there are 3-4 tables that can be used, when I came here all the chairs were full so I just ordered a drink and went home even though the intention was to work. For the cappuccino and coffee peng that I ordered, I can''t lie that it''s really delicious. Soft, it feels right. In my opinion, Duende Coffee can be proud of its coffee because it deserves the superior taste of its drink. I also didn''t find any snacks on the menu. Are you a coffee specialist?', 'Working', 'Positif', 'Duende');
INSERT INTO reviews (nama_pengulas, rating_bintang, teks_ulasan, topik_utama, sentimen, nama_cafe) VALUES ('Jacklyn', 4, 'Duende Coffee is a coffee shop which is intended for people who like coffee, because the place is small, not too big, and only provides coffee-(non-)coffee. Favorite coffee place in Pare-Pare, because apart from the delicious coffee, unlike the taste of contemporary coffee, the price is also relatively cheap. Basically, if you go to Pare2 and like coffee, you really have to stop here. Instead of being confused about where to have coffee', 'Coffee', 'Positif', 'Duende');
INSERT INTO reviews (nama_pengulas, rating_bintang, teks_ulasan, topik_utama, sentimen, nama_cafe) VALUES ('Isdhar mantovani', 4, 'The coffee is great, recommended for coffee lovers, you must try the coffee latte without sugar... the room is smoke free but there is a special room for smokers, great', 'Coffee', 'Positif', 'Duende');
INSERT INTO reviews (nama_pengulas, rating_bintang, teks_ulasan, topik_utama, sentimen, nama_cafe) VALUES ('Anshor Muhajir', 5, 'Very aesthetic shop, good interior and cozy place. The drink menu is very diverse, and different from cafes in general in this city. If you are a coffee lover, you must come here', 'Coffee', 'Positif', 'Duende');
INSERT INTO reviews (nama_pengulas, rating_bintang, teks_ulasan, topik_utama, sentimen, nama_cafe) VALUES ('Eightline Zone', 4, 'Location near Mattirotassi beach. The indoor is air-conditioned, there is a room for vape users. The terrace can only accommodate 4-6 chairs. I ordered blended milk coffee (60-40). Enjoyment. The option to sit is to cross to the gazebo at Mattirotassi Beach.', 'Coffee', 'Positif', 'Duende');
